theme_mods.custom_css_string:
/* header-logo-width 
=========================*/
.aux-logo-header .aux-logo-anchor{ max-width:165px; }
/* header-logo-max-height-type 
=========================*/
.aux-logo-header .aux-logo-anchor > img { max-height:115px; }
/* site-body-background-pattern 
=========================*/
body:before { height:100%; background-image:url(); }
/* site-body-background-size 
=========================*/
body { background-size:auto; }
/* site-body-background-repeat 
=========================*/
body { background-repeat:no-repeat; }
/* site-body-background-position 
=========================*/
body { background-position:left top; }
/* site-body-background-attach 
=========================*/
body { background-attachment:scroll; }
/* site-frame-background-color 
=========================*/
@media screen and (min-width: 700px) { .aux-framed .aux-side-frames, body.aux-framed:after,
            .aux-framed .aux-side-frames:before, .aux-framed .aux-side-frames:after{ background-color:#111111; } }
/* site-header-container-height 
=========================*/
.site-header-section .aux-header-elements:not(.aux-vertical-menu-elements), .site-header-section .aux-fill .aux-menu-depth-0 > .aux-item-content { height:115px; }
/* site-transparent-header-bgcolor 
=========================*/
.site-header-section { background-color:#FFFFFF; }
/* site-header-container-scaled-height 
=========================*/
.aux-top-sticky .site-header-section.aux-sticky .aux-fill .aux-menu-depth-0 > .aux-item-content, .aux-top-sticky .site-header-section.aux-sticky .aux-header-elements,.aux-elementor-header.aux-sticky .elementor-section-wrap > .elementor-section > .elementor-container { min-height:80px; }
/* sticky-header-color 
=========================*/
.aux-elementor-header.aux-sticky .elementor-section-wrap > .elementor-section { background-color:#FFFFFF !important; }
/* site-vertical-menu-background-color 
=========================*/
.aux-vertical-menu-side  { background-color:#FFF; }
/* site-header-navigation-item-height 
=========================*/
.site-header-section .aux-middle .aux-menu-depth-0 > .aux-item-content { height:60px; }
/* site-mobile-header-toggle-button-color 
=========================*/
.site-header-section .aux-header .aux-burger:before, .site-header-section .aux-header .aux-burger:after, .site-header-section .aux-header .aux-burger .mid-line{ border-color:#3d3d3d; }
/* site-menu-full-screen-background-color 
=========================*/
#fs-menu-search:before { background-color:rgba(255, 255, 255, 0.95); }
/* site-top-header-background-color 
=========================*/
#top-header{background-color:#FFFFFF;}
/* post-title-bar-overlay-pattern-opacity 
=========================*/
.single-post .aux-overlay-bg-hash::before { opacity:0.15; }
/* page-title-bar-overlay-pattern-opacity 
=========================*/
.page .aux-overlay-bg-hash::before { opacity:0.5; }
/* subfooter-bar-layout-bg-color 
=========================*/
.aux-subfooter-bar { background-color:#fafafa; }
/* subfooter-bar-top-border-color 
=========================*/
.aux-subfooter-bar { border-top:1px solid #EAEAEA; }
/* subfooter-layout-bg-image-position 
=========================*/
.aux-subfooter{background-position:center center;}
/* subfooter-layout-bg-image-size 
=========================*/
.aux-subfooter{background-size:cover;}
/* subfooter-layout-bg-image-repeat 
=========================*/
.aux-subfooter{background-repeat:no-repeat;}
/* subfooter-top-border-color 
=========================*/
.aux-subfooter { border-top:1px solid #EAEAEA; }
/* site-footer-bg-color 
=========================*/
.aux-site-footer{background-color:#1A1A1A;}
/* footer-top-border-color 
=========================*/
.aux-site-footer{border-top:1px solid #EAEAEA;}
/* footer-top-border-width 
=========================*/
.aux-site-footer { border-top-width:1px; }
/* site-secondary-logo-max-height 
=========================*/
.aux-logo-footer .aux-logo-anchor img { max-height:50px; }
/* site-top-header-text-color 
=========================*/
.aux-top-header, .aux-top-header a{color:#101010 !important;}
/* content-typography 
=========================*/
body { font-family: "Poppins";font-weight: regular; }
/* main-title-typography 
=========================*/
h1, h2, h3, h4, h5, h6, .aux-h1, .aux-h2, .aux-h3, .aux-h4, .aux-h5, .aux-h6 { font-family: "Poppins";font-weight: 600; }
/* page-title-typography 
=========================*/
.page-title { font-family: "Raleway";font-weight: 300; }
/* header-menu-typography 
=========================*/
.aux-master-menu { font-family: "Poppins";font-weight: 600; }
/* buttons-typography 
=========================*/
.aux-button { font-family: "Poppins";font-weight: regular; }
/* product-title-bar-overlay-pattern-opacity 
=========================*/
.single-product .aux-overlay-bg-hash::before { opacity:0.5; }
/* blog-post-share-button-icon-size 
=========================*/
.single-post .aux-single-post-share span::before { font-size:10px; }
/* product-single-wishlist-button-icon-size 
=========================*/
.single-product .auxshp-wishlist .auxshp-wishlist-icon::before { font-size:25px; }
/* product-single-share-button-icon-size 
=========================*/
.single-product .aux-share-btn span::before { font-size:25px; }
/* site-featured-color-1 
=========================*/
:root{--auxin-featured-color-1: #ff2929;}
/* site-featured-color-2 
=========================*/
:root{--auxin-featured-color-2: #101010;}
/* site-featured-color-3 
=========================*/
:root{--auxin-featured-color-3: #c5c5c5;}
/* site-featured-color-4 
=========================*/
:root{--auxin-featured-color-4: #ef1e33;}

sliders.custom_styles:
.msp-cn-2-2 { background-color:#e42121;font-weight:normal;line-height:normal; } 
.msp-cn-2-8 { font-family:"Poppins";font-weight:normal;font-size:30px;letter-spacing:3px;line-height:42px;color:#101010; } 
.msp-cn-2-9 { font-family:"Poppins";font-weight:700;font-size:45px;line-height:60px;color:#101010; } 
.msp-cn-2-10 { background-color:#4e4e4e;font-weight:normal;line-height:normal; } 
.msp-cn-2-12 { font-family:"Poppins";font-weight:normal;font-size:16px;line-height:25px;color:#4e4e4e; } 
.msp-cn-2-13 { padding-top:15px;padding-right:50px;padding-bottom:15px;padding-left:50px;font-family:"Poppins";font-weight:normal;font-size:16px;line-height:normal;color:#ffffff; } 
.msp-cn-1-15 { background-color:#e42121;font-weight:normal;line-height:normal; } 
.aux-shop-fashion-slider-hotspot .ms-tooltip-point .ms-point-center {
	width: 21px;
 	height: 21px;
  	background: #FF2929;
 	border: 4px solid #FFF;
}
.aux-shop-fashion-slider-small-hotspot .ms-tooltip-point .ms-point-center {
	width: 16px;
 	height: 16px;
  	background: #FF2929;
 	border: 4px solid #FFF;
}

.aux-shop-fashion-slider-2 .ms-tooltip-cont {
	background:  #FFF !important;
  text-align: center;
  text-shadow: none !important;
  box-shadow : 0 3px 20px rgba(0, 0, 0, 0.26);
  padding: 10px 20px !important;
}
.aux-shop-fashion-slider-2 .ms-tooltip-arrow {
  display: none;
}
.aux-rating-box {
  font-size: 18px;
}
.aux-rating-box.aux-star-rating:before {
 color: #EF1E33 
}
.aux-rating-box.aux-star-rating .aux-star-rating-avg:before {
  color: #EF1E33
}

.aux-shop-fashion-hotspot-button{ 
	background: #FF2929 !important;
}

