selector .aux-filters ul {
    display: flex;
    width: 100%;
    justify-content: space-between;
    flex-flow: row wrap;
    padding-left: 0;
}
selector .aux-filters ul > li  span {
    padding: 0;
}
selector .aux-filters ul > li {
    font-size:20px;
    font-family: "Poppins", Sans-serif;
}

selector .aux-filters.aux-slideup li > a {
    text-transform: none;
}
selector .aux-filters.aux-slideup .aux-selected span::before, selector .aux-filters.aux-slideup .aux-selected span::after {
    color: #FF2929;
}
selector .aux-filters.aux-slideup li:first-child > a span {
    padding-left: 0;

}
selector .aux-filters.aux-slideup li:last-child > a span {
    padding-right: 0;

}

selector .aux-left.aux-ajax-filters ul {
    margin-left: 30px;
}

selector .aux-sort-filter  {
    position: absolute;
    right: 0;
    top: 5px;
}

selector .aux-sort-filter ul {
    min-width: 300px;
transform: translateY(60px);
}

selector .aux-filters.aux-dropdown-filter .aux-filter-by {
    font-weight: 600;
    text-transform: none;
    font-size: 23px;
    color: #101010;
    padding: 10px;
}

selector .aux-filters.aux-dropdown-filter .aux-filter-by .aux-filter-name {
    vertical-align: middle;
    color: #101010;
}

selector .aux-recent-products-pro-wrapper {
    margin-top: 35px;
}

selector .aux-filters.aux-dropdown-filter li > a {
    font-size: 17px;
    text-transform: none;
    font-weight: 400;
    padding: 0;
    color: #4E4E4E;
}

selector .aux-filters.aux-dropdown-filter li:hover {
    background: transparent;
}
selector .aux-filters.aux-dropdown-filter li:hover a {
    color: #FF2929;
}

selector .aux-filters.aux-dropdown-filter li {
    margin:  0 30px;
}

selector .aux-filters.aux-dropdown-filter > ul {
    padding: 40px 0px;
}

selector .aux-filters.aux-dropdown-filter > ul.aux-active {
    transform: translateY(50px);
}

selector .aux-widget-recent-products-pro .onsale {
    width: 75px;
    height: 75px;
}

selector .aux-shop-info-wrapper {
    display: block;
}

selector .auxshp-loop-title {
    max-width: 100%;
}

selector .woocommerce-Price-currencySymbol {
    margin-right: 7px;
}

selector ins {
    background-color: transparent;
    padding: 0;
    margin-right: 25px;
    vertical-align: middle;
}
selector del {
    text-decoration: none;
    padding-right: 5px;
    position: relative;
}

selector del:after{
    content: '';
    width: 100%;
    height: 1px;
    position: absolute;
    top: 50%;
    background: #707070;
    left: 0;
    transform: translateY(-50%);
}
selector del .woocommerce-Price-amount {
    font-size: 21px;
    color:  rgba(16, 16, 16, 0.5);
}

selector .price {
    max-width: 100%;
}

selector .aux-shop-meta-wrapper {
    display: block;
}

selector .aux-shop-meta-terms {
    display: block;
    margin-bottom: 7px;
    color: #C5C5C5;
}
selector .auxshp-entry-main {
    position: relative;
}
selector .aux-shop-btns-wrapper {
    background: rgb(67,67,67); /* Old browsers */
background: -moz-linear-gradient(left, rgb(67,67,67) 0%, rgb(0,0,0) 100%); /* FF3.6-15 */
background: -webkit-linear-gradient(left, rgb(67,67,67) 0%,rgb(0,0,0) 100%); /* Chrome10-25,Safari5.1-6 */
background: linear-gradient(to right, rgb(67,67,67) 0%,rgb(0,0,0) 100%); /* W3C, IE10+, FF16+, Chrome26+, Opera12+, Safari7+ */
    border: none;
    display: block;
    margin: 0;
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    clip-path: inset(0 0 100% 0);
    transition: all 500ms cubic-bezier(0.215, 0.61, 0.355, 1);

}
selector .add_to_cart_button{
    color: #FFFFFF;
    line-height: normal;
    font-size: 20px;
    text-transform: uppercase;
    font-weight: 400;
    float: left;
     margin-top: 10px;
}

selector .add_to_cart_button i {
    display: none;
}
selector .aux-shop-btns-wrapper:after {
    content: "";
    display: table;
    clear: both;
}
selector .auxshp-wishlist-wrapper {
    display: inline-block;
    float: right;
}

selector .aux-widget-recent-products-pro .aux-shop-btns-wrapper .auxshp-wishlist .aux-wishlist-icon{
    color: #FFF;
    font-size: 31px;
}

selector  .type-product:hover .aux-shop-btns-wrapper {
    clip-path: inset(0 0 0 0);
    transform: translateY(-100%);
}

selector .auxshp-loop-title {
    margin-bottom: 6px;
}

selector .aux-shop-quicklook-wrapper {
    font-size: 25px;
    color: #FFF;
    float: right;
    position: relative;
    top: 4px;
}

selector .aux-shop-quicklook:hover {
    color:#FFF;
}

selector .aux-shop-btns-wrapper a {
    max-width: 60%
}

@media only screen and (max-width:768px) {
    selector .aux-filters {
        width: 60%;
    }
}
