post_meta.aux_page_custom_css:
#top-header {
    position:absolute;
    top:0;
    left:0;

}
.site-header-section{
    position: absolute;
    top: 50px;
    left: 0;
    background:transparent;
}
#site-title {
    background: url('https://demo.phlox.pro/fashion-shop/wp-content/uploads/sites/72/2018/10/attractive-woman-listening-to-music-from-cell-PVAS384.jpg');
    min-height: 550px;
    display: flex;
    align-items: center;
    
}

#site-title .page-header {
    border: none;
}

.page-title {
    color: #101010;
    font-family: "Poppins", Sans-serif;
    font-size: 40px;
    font-weight: 400;
    line-height: 56px;
    background: rgba(255, 255, 255, 0.9);
    position: relative;
    padding: 57px 40px 52px 40px;
    margin-top: 60px;
    min-width: 500px;
}

.page-title:after {
    content: '';
    display: block;
    width: 130px;
    height: 3px;
    background-color: #FF2929;
    margin-top: 18px;
}

/* Shop Page */

.aux-filters.aux-dropdown-filter.aux-right  {
	display: inline-flex !important;
	float:right !important;
}

@media only screen and (min-width:768px) and (max-width:1024px){
    .site-header-section{
        top: 35px ;
    }
    
    .page-title {
        margin-top: 90px;
    }
}
@media only screen and (max-width:767px) {
    .site-header-section{
        top: 75px ;
    }
    .page-title {
        min-width: 100%;
        margin-top: 100px;
    }
}
